import React from "react";
import earth from "../Images/Logos/earth.png"

interface Props {
    shorthands: string[],
    titles: string[],
    degrees: string[],
    times_and_places: string[],
    descriptors: string[]
}

class Education extends React.PureComponent<Props>{
    render() {
        const { shorthands, titles, degrees, times_and_places, descriptors } = this.props;
        var cards = [];
        for (let i = 0; i < degrees.length; i++) {
            const short = shorthands[i];
            const title = titles[i];
            const degree = degrees[i];
            const context = times_and_places[i];
            const descriptions = descriptors[i];

            cards.push(
                <div className="card">
                    <img className="school_img" src={"Images/InstitutionLogos/" + short + ".jpeg"} alt={short} />
                    <div className="container">
                        <h2>{title}</h2>
                        <h3>{degree}</h3>
                        <h4>{context}</h4>
                        <p>{descriptions}</p>
                    </div>
                </div>
            )
        }
        return (
            <section id="education">
                <h1>Brain buildings:</h1>
                <div className="schools">
                    {cards}
                </div>
            </section>
        );
    }
}

export default Education;
